import React, { Component } from 'react'

import 'bootstrap/dist/css/bootstrap.min.css'

export default class CardScore extends Component {
   render() {

      const { headerText, bodyText, cardText } = this.props;

      return (
         <div class="card bg-danger m-2 text-white">
            <div class="card-body">
               <h6>{this.props.title}
               <span class="fa fa-arrow-alt-circle-down right-align">
                  </span>
                  <b class="right text-sm">{this.props.body}</b>
               </h6>
               <h1>
                  <span class="fa fa-stopwatch"></span>
                  <span class="right text-big">{this.props.val}</span>
               </h1>
            </div>
         </div>
      )
   }
}
